function cn() {
  var args = arguments,
      classes = [];
  for (var i in args) {
    var arg = args[i];
    if (!arg) continue;
    if ('string' === typeof arg || 'number' === typeof arg) {
      classes.push(arg.replace("active", ""));
    } else if ('object' === typeof arg) {
      for (var key in arg) if (arg[key]) classes.push(key);
    }
  }
  return classes.join(' ');
}

